import React from 'react';
import { Text, View, Button } from 'react-native';

export default function Home({ navigation }) {
  return (
    <View>
      <Text> Home 2</Text>
      <Button title="Sobre" onPress={() => navigation.navigate('Sobre')} />
    </View>
  );
}
